package tests.generator.maps

fun g1(param: Map<String, Float>)

fun g2(param: Map<Float, String>)

fun h1() -> result: Float

fun h2() -> result: String

pipeline test {
    g1({});
    g1({"a": 1.2, "b": 1.0});
    g1({h2(): -0.5, "b": h1()});
    g2({1.2: "a", 1.0: "b"});
    g2({5.6: "c", h1(): h2()});
}
